const Contatti = () => {
  return (
    <div style={styles.container}>
      <h1>Contattaci</h1>
      <p>Per informazioni sui nostri corsi e servizi, scrivici a:</p>
      <p>Email: info@beautyarmony.it</p>
      <p>Telefono: +39 123 456 789</p>
    </div>
  );
};

const styles = {
  container: {
    padding: '2rem',
    textAlign: 'center',
  },
};

export default Contatti;
